import React from 'react';

function Module() {
  return (
      <div className="modalBackground">
          <div className="modalContainer">
              <button>X</button>
              <div className="title">
                  <h1>Are you sure you want continue ?</h1>
              </div>
              <div className="body"></div>
              <div className="footer"></div>
          </div>
         
      </div>
  )
}

export default Module;
